import React from "react";
import styled from "styled-components";
import Menu from "./menu";

const Landing = () => {
  return (
    <div>
      <Menu></Menu>
      <Section1>
        <GetStarted>
          <div className="leftSection">
            <div className="header">
              Easily create beautiful components with amazing speed. Easily
              create beautiful components with amazing speed.
            </div>
          </div>
          <div className="rightSection">
            {" "}
            Easily create beautiful components with amazing speed. Easily create
            beautiful components with amazing speed.
          </div>
        </GetStarted>
      </Section1>
    </div>
  );
};

export default Landing;

const Section1 = styled.div`
  width: 100%;
  height: 1309px;
  left: 0px;
  top: 0px;

  background: linear-gradient(
    335.93deg,
    #ffffff 30.99%,
    rgba(255, 255, 255, 0) 100%
  );
`;

const GetStarted = styled.div`
  display: flex;
  flex-direction: row;
  height: 600px;
  background-color: grey;

  .leftSection {
    width: 50%;

    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 0 100px;
    background-color: lightgrey;
  }

  .rightSection {
    width: 50%;
    height: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 0 100px;
    background-color: lightgrey;
  }

  .header {
    font-size: 40px;
  }
`;
